import React from 'react';

class Developer extends React.Component {
    render() {
        return (
            <div>
                <h2>{this.props.name}</h2>
                <p>920927</p>
                <p>남자</p>
                <p>대학원생</p>
            </div>
        )
    }
}

export default Developer;
